CREATE DATABASE ANSI;
USE ANSI;

CREATE TABLE DISH
(
    DISH_ID INT NOT NULL AUTO_INCREMENT,
    DISH_NAME VARCHAR(150) NOT NULL,
    MAIN_CATEGORY VARCHAR(100) NOT NULL,
    MAKE_TIME_MIN INT NOT NULL,
    PREPARATION_DIFFICULTY VARCHAR(50) NOT NULL,
    INGREDIENTS_CATEGORY VARCHAR(50) NOT NULL,
    INGREDIENTS_TAGS VARCHAR(300) NOT NULL,
    DISH_RECIPE_URL VARCHAR(300),
    PRIMARY KEY (DISH_ID)
);

SET NAMES utf8mb4;
